# Policy Servis Dokümantasyonu

Bu doküman, `InsurGateway`'in `Policy` servisinde kullanabileceğiniz metotları barındırır. Servisin doğru kullanımı için gerekli olan bilgileri metotlara ait açıklamalar içerisinde bulabilirsiniz.

## VerifyPayment

`InsurGateway` üzerinden sigorta şirketlerinden ödeme işlemini doğrulayabileceğiniz servistir. Bu servisi kullanarak sigorta şirketinden ilgili **poliçenin** ödeme bilgilerini doğrulayabilirsiniz.

### Parametreler

İlgili methodun ihtiyaç duyduğu parametreler ve bunların açıklaması aşağıda tablo halinde verilmiştir.

| İsim | Tip | Açıklama |
|:--|:--:|--:|
| keyValuePairs | Dictionary<int, List<string\>> | Servise gönderilecek key - value değerlerini tutar. İhtiyaç halinde key için birden fazla değer gönderilebilir. |

keyValuePairs parametresi boş gönderildiği taktirde, SDK tarafından boş gönderilemeyeceğine yönelik hata mesajı dönecektir.

{% error %}
:warning: keyValuePair için null veya boş değer olamaz!
{% end %}

### Zorunlu Keyler

Servisin geliştirme kiti tarafından başarılı şekilde `InsurGateway` servislerine erişebilmesi için metot özelinde zorunlu tutulan keyler aşağıda belirtilmiştir.

Belirtilen keyler gönderilmediği taktirde SDK, `InsurGateway` servislerini tetiklemez.

| Key | Açıklama |
|:--|--:|
| 113 | Acente Id |
| 114 | Acente Kullanıcı Adı |
| 115 | Acente Şifresi |

{% error %}
:warning: Acente giriş bilgileri eksik!
{% end %}

| Key | Açıklama |
|:--|--:|
| 328 | Poliçe Numarası |
| 1130 | Tahsilat Tutarı |
| 1132 | Tahsilat Tarihi |

{% error %}
:warning: Zorunlu keyler eksik!
{% end %}

### Cevap Nesnesi

Servisten dönecek olan alanlar ve bunlara ait açıklamalar aşağıda tablo halinde verilmiştir.

| İsim | Tip | Açıklama |
|:---|:---:|---:|
| OperationId | string | Operasyona ait eşsiz id bilgisi |
| PaymentNo| string  | Tahsilat numarası |
| PaymentAmount| string | Tahsilat tutarı |
| RefundAmount| string  | İade tutarı |

### Kullanım Örneği

```csharp
// gönderilecek key-value listesi oluşturulur.
var keyValueList = new Dictionary<int, List<string>>() 
{
    { 113, new List<string>() { "1" }},
    { 114, new List<string>() { "username" }},
    { 115, new List<string>() { "password" }},

    { 328 , new List<string>() { "1234567" }},
    { 1130 , new List<string>() { "2152.50" }},
    { 1132 , new List<string>() { "17.02.2022" }}
};

// asenkron bir metot içerisindeysek:
var response = await new InsurGatewaySDK.Shared.Policy()
                            .VerifyPayment(keyValueList);

// write your codes
```

Eğer asenkron bir metot içerisinde değilsek ve await operatörünü kullanamıyorsak, response aşağıdaki şekilde de alınabilir.

```csharp
// senkron bir metot içerisindeysek:
var response = Task.Run(async () => await new InsurGatewaySDK.Shared.Policy().VerifyPayment(keyValueList))
                   .ConfigureAwait(false)
                   .GetAwaiter()
                   .GetResult();

// write your codes
```
